import{_ as o}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as n,c as p,a as e,b as a,d as r,e as c,r as i}from"./app.7b6c8628.js";const d={},s=c('<h1 id="typora-永久破解" tabindex="-1"><a class="header-anchor" href="#typora-永久破解" aria-hidden="true">#</a> Typora 永久破解</h1><h3 id="typora-v1-2-4-windows-破解-正式开始" tabindex="-1"><a class="header-anchor" href="#typora-v1-2-4-windows-破解-正式开始" aria-hidden="true">#</a> Typora v1.2.4 （Windows）破解，正式开始</h3><p><strong>Typora</strong>是一款简单易用的 Markdown 编辑器。</p><p>Markdown 是一种可以使用普通文本编辑器编写的标记语言，通过简单的标记语法，它可以使普通文本内容具有一定的格式，其目标是实现易读易写。</p><p>而 Typora 则是一个非常不错的 Markdown 编辑器，它的界面非常的简洁直观，并且功能各方面也是非常的不错，例如实时预览功能在完成输入后就可以看到这些内联样式，并在键入时或按下“Enter”键或焦点到另一个段落后查看块样式。</p><p>并且 Typora 将为您提供读者和作家的无缝体验。它删除了预览窗口，模式切换器，降价源代码的语法符号以及所有其他不必要的干扰。将它们替换为真实的实时预览功能，以帮助您专注于内容本身。</p><p><strong>一、 下载破解文件</strong></p><p>PS: 破解文件页面提取人数过多，导致分享的百度网盘链接容易被封：</p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/nice-article/itmind-typorayjpx-4527dc18-83b0-4e87-bd00-9cd729294d11.png" alt="Typora v1.2.4 （Windows）破解版！亲测有效" loading="lazy"></p><p>蛋疼 ing，为限制人数，目前暂不提供页面直接提取，<strong>改为从笔者公众号提取</strong>。</p><p>需要的小伙伴，扫描下方公众号二维码，或者关注公众号： <strong>musk</strong>，回复关键字：<strong>typora</strong> 即可免费无套路获取，持续更新中~</p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/nice-article/itmind-typorayjpx-9facc169-cdee-43af-b452-97f03a7b0ae7.jpg" alt="" loading="lazy"></p><p><strong>二、 解压文件</strong></p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/nice-article/itmind-typorayjpx-66f38b4e-cbee-439c-9428-475dbe9dc0d0.png" alt="" loading="lazy"></p><p><strong>三、 安装 Typora</strong></p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/nice-article/itmind-typorayjpx-7a221021-28f1-4a43-9bef-eca73d7497da.png" alt="" loading="lazy"></p><p>记录下安装目录，点击安装，</p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/nice-article/itmind-typorayjpx-f94f4750-70b3-4300-843c-7d9c4fbba8a1.png" alt="" loading="lazy"></p><p>将解压出的 app.asar 文件移动到安装目录下 resource 文件夹，app.asar 替换文件。</p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/nice-article/itmind-typorayjpx-c360ba4c-90a2-4ff1-8800-be9975a212ef.png" alt="" loading="lazy"></p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/nice-article/itmind-typorayjpx-50373635-2c1b-4b49-b645-f4012d4ca327.png" alt="" loading="lazy"></p><p><strong>四、 重启 Typora</strong></p><p><strong>五、输入任意邮箱号与使用说明中提供的序列号完成激活</strong></p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/nice-article/itmind-typorayjpx-05404fe4-21cf-4fb5-8afc-cc963c66f5b3.png" alt="" loading="lazy"></p><p><img src="http://cdn.tobebetterjavaer.com/tobebetterjavaer/images/nice-article/itmind-typorayjpx-b405d199-1ca2-453f-a3cd-dcad1257ef69.png" alt="" loading="lazy"></p><h4 id="其他" tabindex="-1"><a class="header-anchor" href="#其他" aria-hidden="true">#</a> 其他</h4>',26),l={href:"https://tobebetterjavaer.com/nice-article/itmind/typorayjpx.html",target:"_blank",rel:"noopener noreferrer"},b={href:"https://tobebetterjavaer.com/nice-article/typoramaczwpjbhyjjdkptmarkdownbjqmksimacsocom.html",target:"_blank",rel:"noopener noreferrer"},m={href:"https://tobebetterjavaer.com/nice-article/itmind/",target:"_blank",rel:"noopener noreferrer"};function g(y,h){const t=i("ExternalLinkIcon");return n(),p("div",null,[s,e("ul",null,[e("li",null,[e("a",l,[a("Typora Windows 版永久破解"),r(t)])]),e("li",null,[e("a",b,[a("Typora macOS 版永久破解"),r(t)])]),e("li",null,[e("a",m,[a("破解合集"),r(t)])])])])}const v=o(d,[["render",g],["__file","typorayjpx.html.vue"]]);export{v as default};
